CREATE DATABASE IF NOT EXISTS SchoolDB;
USE SchoolDB;

CREATE TABLE IF NOT EXISTS Orders (
    OrderID INT AUTO_INCREMENT,
    CustomerID INT,
    OrderDate DATE,
    ProductID INT,
    Quantity INT,
    PRIMARY KEY (OrderID)
);


-- Write query to create the index that you will create to optimize a query like
-- SELECT * FROM Orders WHERE CustomerID = {abc} AND OrderDate > '{abc}';
create index idx_orders_customers_orderdate on Orders (CustomerID, OrderDate);
